import logo from "./logo.svg";
import "./App.css";
import Datas from "./data.json";

function App() {
  return (
    <div className="App">
      <h1>APP</h1>
      <ul>
        {Datas.map((data, index) => {
          return <li key={index}>{data}</li>;
        })}
      </ul>
    </div>
  );
}

export default App;
